import { Routes, Route } from 'react-router-dom';

import './App.css';
import MainPage from './containers/mainPage';


function App() {
  return (
    <div className="App">
      <Route path='/welcome' element={<MainPage />} />
      <Route path="/" element={<Navigate replace to='/welcome' />} />
    </div>
  );
}

export default App;
